import React from 'react';

const Intro = () => (
    <>
        <div data-aos="fade-up">
            <h1>Hello, I'm Kelly</h1>
            <div class="row justify-content-center ">
                <h2 class = "col-lg-6 mt-3">I'm a Designer, Developer &amp; Engineering Student @ UC Berkeley</h2>
            </div>
            <div class="row justify-content-center ">
                <h3 class = "col-lg-7 mt-3">I design and develop to enhance user experiences. My current efforts include...</h3>
            </div>

            <Typewriter

            onInit={(typewriter)=> {

            typewriter

            .typeString("Project Mentor @ Lululemon through Berkeley Innovation  ")

            .pauseFor(1000)
            .deleteAll()
            .typeString("Welcomes You")
            .start();
            }}
            />

        </div>
    </>
    );

export default Intro;
